  [],\n\t\"revision_timestamp\": \"2016-10-26T17:56:43.395435\",\n\t\"name\": \"hospital-readmissions-reduction-program\",\n\t\"isopen\":
  true,\n\t\"url\": null,\n\t\"notes\": \"<p>In October 2012, CMS began reducing Medicare
  payments for Inpatient Prospective Payment System hospitals with excess readmissions.
  Excess readmissions are measured by a ratio, by dividing a hospitalu00e2u0080u0099s
  number of u00e2u0080u009cpredictedu00e2u0080u009d 30-day readmissions for heart
  attack, heart failure, and pneumonia by the number that would be u00e2u0080u009cexpected,u00e2u0080u009d
  based on an average hospital with similar patients. A ratio greater than 1 indicates
  excess readmissions.</p>n\",\n\t\"license_title\": \"Other License Specified\",\n\t\"extras\":
